import{_ as t,c,a2 as p,o as e}from"./chunks/framework.eme8ZeBJ.js";const n=JSON.parse('{"title":"梵隆机箱","description":"","frontmatter":{},"headers":[],"relativePath":"case/fanlong.md","filePath":"case/fanlong.md","lastUpdated":null}'),o={name:"case/fanlong.md"};function s(m,a,i,l,h,r){return e(),c("div",null,a[0]||(a[0]=[p('<h1 id="梵隆机箱" tabindex="-1">梵隆机箱 <a class="header-anchor" href="#梵隆机箱" aria-label="Permalink to &quot;梵隆机箱&quot;">​</a></h1><p>梵隆这个厂商主要是做服务器机箱的，它家的机箱我装过非常多，整体感受是：做工非常扎实，用料实在，单看机箱本体重量就能明白。机箱设计结构合理，散热都没问题。而且相对其它同配置的机箱性价比高，缺点就是设计没那么好看。</p><h2 id="_4-盘位-sata-接口" tabindex="-1">4 盘位（SATA 接口） <a class="header-anchor" href="#_4-盘位-sata-接口" aria-label="Permalink to &quot;4 盘位（SATA 接口）&quot;">​</a></h2><p>白色，支持 ITX 主板，使用 Flex 1U 电源。参考价格：￥287。</p><p><img src="https://img.slarker.me/wiki/1726408436156.webp" alt=""></p><p><img src="https://img.slarker.me/wiki/1726408495146.webp" alt=""></p><h2 id="_4-盘位-8643-接口" tabindex="-1">4 盘位（8643 接口） <a class="header-anchor" href="#_4-盘位-8643-接口" aria-label="Permalink to &quot;4 盘位（8643 接口）&quot;">​</a></h2><p>黑色，支持 ITX 主板，使用 Flex 1U 电源，背板接口为 8643 接口，背板支持温控，成本会高一些。参考价格：￥390。</p><p><img src="https://img-1255332810.cos.ap-chengdu.myqcloud.com/1721210760427_DVQH9v.png" alt="1721210760427_DVQH9v"></p><p><img src="https://img-1255332810.cos.ap-chengdu.myqcloud.com/1721210760419_WYLsVQ.png" alt="1721210760419_WYLsVQ"></p><h2 id="_8-盘位" tabindex="-1">8 盘位 <a class="header-anchor" href="#_8-盘位" aria-label="Permalink to &quot;8 盘位&quot;">​</a></h2><h3 id="matx" tabindex="-1">MATX <a class="header-anchor" href="#matx" aria-label="Permalink to &quot;MATX&quot;">​</a></h3><p>支持 MATX 主板，扩展性要比 ITX 好很多，使用 Flex 1U 电源。参考价格：￥535。</p><p><img src="https://img-1255332810.cos.ap-chengdu.myqcloud.com/1715267756627_m3US1N.jpg" alt="1715267756627_m3US1N"></p><p><img src="https://img-1255332810.cos.ap-chengdu.myqcloud.com/1715267756615_cNtaCk.jpg" alt="1715267756615_cNtaCk"></p><p><img src="https://img-1255332810.cos.ap-chengdu.myqcloud.com/1715267756640_xlkIcv.jpg" alt="1715267756640_xlkIcv"></p><h3 id="atx" tabindex="-1">ATX <a class="header-anchor" href="#atx" aria-label="Permalink to &quot;ATX&quot;">​</a></h3><p>支持 ATX 主板，扩展性拉满，使用 ATX 电源，3.5 寸背板支持 SATA/SAS 硬盘。参考价格：￥880。</p><p><img src="https://img-1255332810.cos.ap-chengdu.myqcloud.com/tb_image_share_1700097111669_ClVbFf.jpg" alt="tb_image_share_1700097111669_ClVbFf"></p><p><img src="https://img-1255332810.cos.ap-chengdu.myqcloud.com/1721211242110_jsSnH9.jpg" alt="1721211242110_jsSnH9"></p><p><img src="https://img-1255332810.cos.ap-chengdu.myqcloud.com/MVIMG_20240302_145542_igZwah.jpg" alt="MVIMG_20240302_145542_igZwah"></p><h3 id="atx-u-2" tabindex="-1">ATX（U.2） <a class="header-anchor" href="#atx-u-2" aria-label="Permalink to &quot;ATX（U.2）&quot;">​</a></h3><p>支持 ATX 主板，扩展性拉满，使用 ATX 电源，3.5 寸背板支持 SATA/SAS 硬盘，还有支持 4 个 U.2 接口的背板。参考价格：￥1380。</p><p><img src="https://img-1255332810.cos.ap-chengdu.myqcloud.com/1721211065987_n9MLS9.png" alt="1721211065987_n9MLS9"></p><p><img src="https://img-1255332810.cos.ap-chengdu.myqcloud.com/1721211065973_Vi4ULS.jpg" alt="1721211065973_Vi4ULS"></p><p><img src="https://img-1255332810.cos.ap-chengdu.myqcloud.com/1721211065960_jpVbcy.png" alt="1721211065960_jpVbcy"></p><h2 id="_12-盘位" tabindex="-1">12 盘位 <a class="header-anchor" href="#_12-盘位" aria-label="Permalink to &quot;12 盘位&quot;">​</a></h2><h3 id="半高" tabindex="-1">半高 <a class="header-anchor" href="#半高" aria-label="Permalink to &quot;半高&quot;">​</a></h3><p>支持 ATX 主板，使用 Flex 1U 电源。参考价格：￥1100。</p><p><img src="https://img-1255332810.cos.ap-chengdu.myqcloud.com/1715268817123_n31aEY.png" alt="1715268817123_n31aEY"></p><p><img src="https://img-1255332810.cos.ap-chengdu.myqcloud.com/1715268817114_LO0shG.jpg" alt="1715268817114_LO0shG"></p><p><img src="https://img-1255332810.cos.ap-chengdu.myqcloud.com/1715268817106_dNmwDB.png" alt="1715268817106_dNmwDB"></p><p><img src="https://img-1255332810.cos.ap-chengdu.myqcloud.com/1715268817098_3DU0tH.png" alt="1715268817098_3DU0tH"></p><p><img src="https://img-1255332810.cos.ap-chengdu.myqcloud.com/IMG_20240607_133210_DsJPUY.jpg" alt="IMG_20240607_133210_DsJPUY"></p><p><img src="https://img-1255332810.cos.ap-chengdu.myqcloud.com/IMG_20240607_133226_kc8uZ6.jpg" alt="IMG_20240607_133226_kc8uZ6"></p><h3 id="全高" tabindex="-1">全高 <a class="header-anchor" href="#全高" aria-label="Permalink to &quot;全高&quot;">​</a></h3><p>支持 ATX 主板，使用 ATX 电源。参考价格：￥1143。</p><p><img src="https://img-1255332810.cos.ap-chengdu.myqcloud.com/tb_image_share_1708280492742.jpg_M1fiE1.png" alt="tb_image_share_1708280492742.jpg_M1fiE1"></p><p><img src="https://img-1255332810.cos.ap-chengdu.myqcloud.com/MVIMG_20240226_164115_IJSGBS.jpg" alt="MVIMG_20240226_164115_IJSGBS"></p><p><img src="https://img-1255332810.cos.ap-chengdu.myqcloud.com/MVIMG_20240226_164144_EXoxN7.jpg" alt="MVIMG_20240226_164144_EXoxN7"></p>',40)]))}const _=t(o,[["render",s]]);export{n as __pageData,_ as default};
